// src/pages/SkillTreePage.js

import 'react-flow-renderer/dist/style.css';
import 'react-flow-renderer/dist/theme-default.css';

import React from 'react';
import ReactFlow from 'react-flow-renderer';

console.log('üîç Rendering SkillTreePage with nodes:', nodes);
console.log('üîç ReactFlow component:', ReactFlow);

// ‚ë† Define your nodes with inline styles
const nodes = [
  {
    id: '1',
    type: 'input',
    data: { label: 'Start Here', credits: 0 },
    position: { x: 250, y: 0 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 120,
      textAlign: 'center'
    },
  },
  {
    id: 'surgery',
    data: { label: 'Oral Surgery', credits: 0 },
    position: { x: 100, y: 150 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 150,
      textAlign: 'center'
    },
  },
  {
    id: 'ortho',
    data: { label: 'Orthodontics', credits: 0 },
    position: { x: 250, y: 150 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 150,
      textAlign: 'center'
    },
  },
  {
    id: 'endo',
    data: { label: 'Endodontics', credits: 0 },
    position: { x: 400, y: 150 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 150,
      textAlign: 'center'
    },
  },
  {
    id: 'restor',
    data: { label: 'Restorative Dentistry', credits: 0 },
    position: { x: 100, y: 300 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 180,
      textAlign: 'center'
    },
  },
  {
    id: 'implant',
    data: { label: 'Implant Dentistry', credits: 0 },
    position: { x: 250, y: 300 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 150,
      textAlign: 'center'
    },
  },
  {
    id: 'radio',
    data: { label: 'Radiology', credits: 0 },
    position: { x: 400, y: 300 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 120,
      textAlign: 'center'
    },
  },
  {
    id: 'tmd',
    data: { label: 'TMD / Orofacial Pain', credits: 0 },
    position: { x: 250, y: 450 },
    style: {
      background: '#fff',
      border: '2px solid #333',
      padding: 8,
      width: 170,
      textAlign: 'center'
    },
  },
];

// ‚ë° Auto-generate edges from ‚ÄúStart Here‚Äù (id="1") to each category
const edges = nodes
  .filter(n => n.id !== '1')
  .map(n => ({
    id: `e1-${n.id}`,
    source: '1',
    target: n.id,
    animated: true,
    style: { stroke: '#333', strokeWidth: 2 }
  }));

export default function SkillTreePage() {
  console.log('üîç Rendering SkillTreePage with nodes:', nodes.length);
  return (
    <div style={{ width: '100vw', height: '100vh' }}>
      <ReactFlow
        elements={[...nodes, ...edges]}
        fitView
        style={{ width: '100%', height: '100%' }}
      />
    </div>
  );
}
